import axios from 'axios'
const baseUrl = 'http://localhost:3001/persons'

const getAll = () =>{
    return axios.get(baseUrl)
}

const create = phoneObject => {
    return axios.post(baseUrl,phoneObject)
}

export default{
    getAll,
    create
}
